const HomePage = (props) => {
    const {Color} = props
return (
    <div className=" row Cont ">
    <div className="  mt-4 col text-center ">
    <p className={`fonts text-${Color==="light"?"dark": "light"}`} style={{fontFamily:"'Fugaz One', cursive"}}>Hii,\n
          I'm a Web,   MERN, React Developer</p>
    </div>


    <div className="md-6 col text-center">
    <Image src={`${Color === "light" ? "/images/Componentblack.png": "/images/PROFILEDARK.png"}`} alt="no image to preview" className="rounded-circle  image "/>
    <div className="text-center ">
    <button type="button" className={`
mb-2 btn btn-secondary bg-${Color==="light"?"dark": "light"} text-${Color}`}>Download Resume</button>
    </div>
    </div>
    
    </div>
)


};

export default HomePage;
